import "./App.css";
import React from "react";
// import ReactDom from "reactdom";
import { Component } from "react";
import CoursePage from "./Coursesales";

class App extends Component {
  render() {
    var courseDetails = [
      { name: "Complete React Course", price: 199 },
      { name: "Complete React Course", price: 200 },
      { name: "Complete React Course", price: 189 },
      { name: "Complete React Course", price: 190 },
    ];
    return (
      <div>
        <h1 id="Header">Buy Your Courses Here</h1>
        <CoursePage courses={this.props.courseDetails} />
      </div>
    );
  }
}
export default App;
